import { Marca } from './../../models/marca.model';
import { MarcaService } from './../../marca.service';
import { Component, OnInit } from '@angular/core';
import {
  FormBuilder,
  FormControl,
  FormGroup,
  Validators,
} from '@angular/forms';
@Component({
  selector: 'gc-marca-create',
  templateUrl: './marca-create.component.html',
})
export class MarcaCreateComponent implements OnInit {
  nome!: string;
  descricao!: string;
  constructor(private marcaService: CursoService) {}
  ngOnInit(): void {
    throw new Error('Method not implemented.');
  }
  onChange(novoValorModalidade: Modalidade) {
    this.modalidade = novoValorModalidade;
  }
  save() {
    const marca: Curso = {
      nome: this.nome,
      descricao: this.descricao,
      modalidade: this.modalidade,
    };
    this.marcaService.save(marca).subscribe(
      (res) => {
        console.log(res);
      },
      (error) => console.log(error)
    );
  }
}
